import React,{Component} from 'react';
import List from './List';
import Title from './Title';
class Main extends Component{
    render(){
      return (
        <div>
          <Title title={'todolist'}/>
          <List tasks={['mow the lawn','walk the dog']}/>
          <List tasks={['go to shop','see the way']}/>
        </div>
      )
  }
  }
export  default Main;
